import React from "react";
import { BrowserRouter as Router, Link } from "react-router-dom";

const Header = () => {
  return (
    <div className="bg-white fixed w-screen top-0 md:ml-48 z-20 mb-2 shadow-md min-h-4 p-4">
      <Router>
        <nav>
          <ul className="flex justify-center">
            <li className="px-4 py-1 rounded-md mx-2 bg-purple-700 text-xl text-white">
                <Link to="/">Home</Link>
            </li>
            <li className="px-4 py-1 rounded-md mx-2 bg-purple-700 text-xl text-white">
                <Link to="/about">About</Link>
            </li>
          </ul>

    <svg class="stroke-current text-purple-600 inline-block h-12 w-12" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg" fill="none" stroke-width="2" stroke-linecap="round" stroke-linejoin="round">
      <circle cx="8" cy="21" r="2"></circle>
      <circle cx="20" cy="21" r="2"></circle>
      <path d="M5.67 6H23l-1.68 8.39a2 2 0 0 1-2 1.61H8.75a2 2 0 0 1-2-1.74L5.23 2.74A2 2 0 0 0 3.25 1H1"></path>
    </svg>

        </nav>
      </Router>
    </div>
  );
};

export default Header;
